import React, { useState } from 'react';

const LocationSelector = ({ onLocationSelect, pickupLocation, deliveryLocation, mode = 'pickup' }) => {

  const handleMapClick = (event) => {
    const rect = event.currentTarget.getBoundingClientRect();
    const x = event.clientX - rect.left;
    const y = event.clientY - rect.top;

    // Convert click position to mock coordinates
    const lat = 33.5731 + (y - 125) * 0.001;
    const lng = -7.5898 + (x - 150) * 0.001;

    onLocationSelect(mode, {
      latitude: lat,
      longitude: lng,
      address: `${lat.toFixed(4)}, ${lng.toFixed(4)}`
    });
  };

  const getMarkerPosition = (location) => {
    if (!location?.latitude) return null;

    // Convert GPS coordinates to pixel position on fake map
    const x = 150 + (location.longitude + 7.5898) / 0.001;
    const y = 125 + (location.latitude - 33.5731) / 0.001;

    return { x: Math.max(10, Math.min(290, x)), y: Math.max(10, Math.min(240, y)) };
  };

  const markerPos = getMarkerPosition(pickupLocation || deliveryLocation);

  return (
    <div>
      {mode === 'home' && (
        <div style={{ marginBottom: '10px', textAlign: 'center' }}>
          <span style={{ color: '#4CAF50', fontWeight: 'bold' }}>üè† Set Home Address</span>
        </div>
      )}
      {mode === 'delivery' && (
        <div style={{ marginBottom: '10px', textAlign: 'center' }}>
          <span style={{ color: '#333', fontWeight: 'bold' }}>üìç Set Delivery Location</span>
        </div>
      )}

      <div 
        onClick={handleMapClick}
        style={{ 
          width: '100%', 
          height: '250px', 
          borderRadius: '15px',
          border: '2px solid #e0e0e0',
          background: `
            radial-gradient(circle at 30% 20%, #4CAF50 2px, transparent 2px),
            radial-gradient(circle at 70% 30%, #2196F3 1px, transparent 1px),
            radial-gradient(circle at 20% 70%, #FF9800 1px, transparent 1px),
            radial-gradient(circle at 80% 80%, #9C27B0 1px, transparent 1px),
            linear-gradient(45deg, #e8f5e8 25%, transparent 25%),
            linear-gradient(-45deg, #e8f5e8 25%, transparent 25%),
            linear-gradient(45deg, transparent 75%, #e8f5e8 75%),
            linear-gradient(-45deg, transparent 75%, #e8f5e8 75%),
            #f0f8f0
          `,
          backgroundSize: '20px 20px, 15px 15px, 25px 25px, 18px 18px, 10px 10px, 10px 10px, 10px 10px, 10px 10px',
          position: 'relative',
          cursor: 'crosshair',
          overflow: 'hidden'
        }}
      >
        {/* Street lines */}
        <div style={{
          position: 'absolute',
          top: '30%',
          left: 0,
          right: 0,
          height: '2px',
          background: '#ddd'
        }} />
        <div style={{
          position: 'absolute',
          top: '70%',
          left: 0,
          right: 0,
          height: '2px',
          background: '#ddd'
        }} />
        <div style={{
          position: 'absolute',
          left: '25%',
          top: 0,
          bottom: 0,
          width: '2px',
          background: '#ddd'
        }} />
        <div style={{
          position: 'absolute',
          left: '75%',
          top: 0,
          bottom: 0,
          width: '2px',
          background: '#ddd'
        }} />

        {!markerPos && (
          <div style={{
            position: 'absolute',
            top: '50%',
            left: '50%',
            transform: 'translate(-50%, -50%)',
            textAlign: 'center',
            background: 'rgba(255,255,255,0.9)',
            padding: '10px',
            borderRadius: '8px'
          }}>
            <div style={{ fontSize: '24px', marginBottom: '5px' }}>üìç</div>
            <div style={{ color: '#666', fontSize: '12px' }}>
              Click to set location
            </div>
          </div>
        )}

        {markerPos && (
          <div 
            style={{
              position: 'absolute',
              left: `${markerPos.x}px`,
              top: `${markerPos.y}px`,
              fontSize: '24px',
              transform: 'translate(-50%, -50%)',
              zIndex: 10,
              filter: 'drop-shadow(0 2px 4px rgba(0,0,0,0.3))'
            }}
          >
            {mode === 'home' ? 'üè†' : 'üìç'}
          </div>
        )}
      </div>

      <p style={{ fontSize: '12px', color: '#666', margin: '5px 0' }}>
        {markerPos ? 'Click to move marker or use GPS for exact location' : `Click anywhere on the map to set ${mode} location`}
      </p>
    </div>
  );
};

export default LocationSelector;
